import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from "react-router-dom";
import Particles from "react-particles-js";



ReactDOM.render(
 <BrowserRouter>
 <Particles 
        params = {{
          particles:{
            number:{
              value:40,
              density:{
                enable: true,
                value_area:900
              }
            }
          }
        }}
        />
   <App />
   </BrowserRouter>,
  document.getElementById('root')
);
